import Card from "../Card/Card";
import "./style.css";
import data from "../../assets/data.json";




function CardList() {
  return (
    <div className="cards">

    {
    data.map((item, index) => <Card key={index} {...item}/>)
      }
    </div>
  )
}


export default CardList;
